    "2015-02-04T19:03:46.678701",nt"name": "housing-litigations-af722",nt"isopen":
    false,nt"url": null,nt"notes": "The Department of Housing Preservation
    and Development (HPD) Housing Litigation Division (HLD) initiates' actions in the
    Housing Court against owners of privately-owned buildings to enforce compliance
    with the housing quality standards contained in the New York State Multiple Dwelling
    Law and the New York City Housing Maintenance Code.  HLD attorneys also represent
    HPD when tenants initiate actions against private owners.  HPD is automatically
    named as party to such actions.  The goal of these court proceedings is to obtain
    enforceable Orders to Correct, Civil Penalties (fines) and Contempt Sanctions, compelling
    owners to comply with the Housing Code.",nt"license_title": "License Not Specified",nt"extras":
